import React from 'react';
import under_gallerie from '../img/underground_gallery.jpg';

const DescSection2 = () => {
  return (
    <div>
      <div className='desc-section2'>
        <img src={under_gallerie} alt="underground gallery" width='100' height='100'/>
      </div>
    </div>
  );
};

export default DescSection2;
